import React from 'react';
import IndexHeader from '../components/Headers/IndexHeader';// Import IndexHeader component
import LandingPageHeader from '../components/Headers/LandingPageHeader';
import ProfilePageHeader from '../components/Headers/ProfilePageHeader';
import DarkFooter from '../components/Footers/DarkFooter';
import DefaultFooter from '../components/Footers/DefaultFooter';
import TransparentFooter from '../components/Footers/TransparentFooter';
import ExamplesNavbar from '../components/Navbars/ExampleNavbar';
import IndexNavbar from '../components/Navbars/IndexNavbar';
import LandingPage from '../views/examples/LandingPage';
import LoginPage from '../views/examples/LoginPage';
import ProfilePage from '../views/examples/ProfilePage';

class HomePage extends React.Component {
  handleButtonClick = (buttonNumber) => {
    alert("Button " + buttonNumber + " clicked!");
  }

  render() {
    return (
      <div>
        {/* Render buttons in the middle */}
        <div className="container mt-5">
          <div className="row justify-content-center">
            <div className="col-md-3 text-center">
              <button className="btn btn-primary btn-lg mb-2" onClick={() => this.handleButtonClick(1)}>Level 1</button>
            </div>
            <div className="col-md-3 text-center">
              <button className="btn btn-secondary btn-lg mb-2" onClick={() => this.handleButtonClick(2)}>Level 2</button>
            </div>
            <div className="col-md-3 text-center">
              <button className="btn btn-success btn-lg mb-2" onClick={() => this.handleButtonClick(3)}>Level 3</button>
            </div>
          </div>
        </div>

        {/* Render other components */}
      
        {/* Render IndexHeader component */}
      
      </div>
    );
  }
}

export default HomePage;
